import React from 'react'
import "./welcome.css";
const welcome = ({ currentUser }) => {
  return (
    <div className='welcome__container'>
      <h1>
        Welcome, <span>{currentUser.username}</span>
      </h1>
      <h3>Please select a chat to start message</h3>

    </div>
  )
}

export default welcome
